/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import "./Shared.css";
import "./Invest.css";
import "./Footer.css";
import { Footer } from "./Footer";


export const Invest: React.FC = () => {
    return (
        <div className="main">
            <h1 className="intro">We are looking for partners</h1>
            <img src="./images/invest.png" />
              <p>
                  As long as this page is up, we’re bootstrapping, eating pasta, and looking for investment. As well as looking for wise, patient board members, who share
                  our moral values and goals and want to help us develop
                  powerful, novel digital therapeutics for the world.
              </p>
              <p>
                  If you’re interested in making money and improving mental health, <a href="mailto: invest@csd.red">let’s talk</a>.
              </p>
              <br /> 
              <p>Would you like to know more?</p>
              <p>
                  <a href="https://mother.technology/files/Mother.pitchdeck_s.pdf">
                      Our pitch deck (pdf).
                  </a>
              </p>
              <h2>Hard work, easy.</h2>
              <Footer />
        </div>
    );
};
